(ns advent.2018.day-5
  (:require [clojure.string :as str]
            [clj-time.core :as t]
            [clj-time.coerce :as c]
            [clj-time.format :as f]
            [clojure.math.numeric-tower :refer [abs]]))

(def input "")

(def example "dabAcCaCBAcCcaDA")

(defn solution-1 [input]
  (->> input
       (reduce (fn [ret c]
                 (if (= 32 (abs (- (int c) (int (or (last ret) 0)))))
                   (str/join (drop-last ret))
                   (str ret c)))
               "")))

(def result-1 (solution-1 input))

(comment (->> result-1
              frequencies
              (reduce-kv
                (fn [ret k v]
                  (let [same-letter (or (not-empty (select-keys ret [(char (- (int k) 32))]))
                                        (not-empty (select-keys ret [(char (+ (int k) 32))])))]
                    (if same-letter
                      (update ret (ffirst same-letter) (partial + v))
                      (assoc ret k v))))
                {})
              (apply max-key val)))

(comment (->> input
              solution-1
              frequencies
              (partition 2)

              (map (fn [x]
                     {(ffirst x) ((partial apply +) (vals x))}))
              (apply conj)
              (apply max-key val)))


(comment (->> input
              solution-1
              (#(str/replace % #"R|r" ""))
              solution-1
              count))



(defn partial-solution-2 [regex]
  {(str regex) (->> result-1
                    (#(str/replace % regex ""))
                    solution-1
                    count)})

(def regexes (->> (concat (range (int \a) (inc (int \z)))
                          (range (int \A) (inc (int \Z))))

                  (map char)
                  (partition 26)
                  (apply interleave)
                  (partition 2)
                  (map (comp re-pattern (partial apply (partial format "%s|%s"))))))

(defn solution-2 []
  (->> (map partial-solution-2 regexes)
       (apply conj)
       (apply min-key val)
       second))

